import { useState } from "react"

export default function SignUp({dataSaleHouse, houseState}) {
    const [house, setHouse] = useState(dataSaleHouse)
    function addHouse() {
        setHouse(e=> {
            return[
                {
                    id : e.id,
                    zagolovok : e.name,
                    text : e.opisanie,
                    img : e.img
                }
            ]
        })
    }
    const [houser, setHouser] = useState(addHouse)
    
    return(
        <div className="registr-form">
            <h1>Зарегестрируйтесь!</h1>
            <input type="text" className="names-form"/>
            <input type="email" name="" id="" className="emails-form"/>
            <input type="number" name="" id="" className="kodes-form"/>
            <button className="register-button">Регистрацыя</button>

            <div className="houses">
                {houser.map(e=> {
                    return(<>
                    <div className="box" key={e.id}>
                      <div className="img-box">
                          <img src={e.img} alt=""/>
                      </div>
                      <div className="detail-box">
                          <h6>{e.zagolovok}</h6>
                          <button className="plus" onClick={addHouse}>{e.plus}</button>
                          <p>{e.text}</p>
                      </div>
            
                    </div>
                    </>)
                })}
            </div>
            
        </div>
    )
}
